import React, { Component } from "react";
import "./Tasks.css";
import { ListItemSecondaryAction } from "@material-ui/core";
var tasks=[];
class Tasks extends Component {
  display(name){
   // items.DeadLines.name;
   console.log(this.props.items);
   console.log("n"+name);
   let items=this.props.items;
   console.log("items"+items[0]);
   for(let i=0;i<items.length;i++)
   {console.log("for");
     console.log(items[i].key);
     if(items[i].key==this.props.currentKey)
     {console.log("found");
      tasks=items[i].DeadLines.name;
      console.log(items[i].DeadLines.Today);
     }
   }
   console.log("cutasks"+tasks);
  }

  render() {
    return (
      <div className="Tasks">
           <p>{this.props.taskName}</p>
          <div className="Card">
            <div className="Task" onClick={this.display.bind(this,"Today")}>
            Today  
            </div>
            <div className="Task" onClick={this.display.bind(this,"Tomorrow")}>
            Tomorrow
            </div>
            <div className="Task" onClick={this.display.bind(this,"Someday")}>
            Someday
            </div>
          </div>

      </div>
    );
  }
}

export default Tasks;
